import React, { Component } from 'react'

export class Info extends Component {
  render() {
    return (
      <div className='container mt-5'>
          <h1>User Info</h1>
          <hr />
          <p><span className='fw-bold'>ID</span></p>
      </div>
    )
  }
}

export default Info
